import React from 'react';
import { Container, Button, Row, Col } from 'react-bootstrap';

const HomePage = ({ setShowRegister, setShowLogin }) => {
  return (
    <Container className="mt-5 text-center">
      <h1 className="display-4">Emergency Response Management System</h1>
      <p className="lead">Report emergencies and manage incidents effectively.</p>
      <Row className="justify-content-center mt-4">
        <Col md={4}>
          <Button variant="primary" size="lg" block onClick={() => setShowRegister(true)}>
            Register
          </Button>
        </Col>
        <Col md={4}>
          <Button variant="secondary" size="lg" block onClick={() => setShowLogin(true)}>
            Login
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
